import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import SignIn from './SignIn';
import SignUp from './SignUp';

function App() {
  return (
    <Router>
      <div>
        <Route path="/" exact component={SignIn} />
        <Route path="/signup" component={SignUp} />
      </div>
    </Router>
  );
}

export default App;
